import React from 'react';
import { motion } from 'framer-motion';

export default function Home(){
  return (
    <div className="container">
      <motion.div initial={{opacity:0}} animate={{opacity:1}} className="glass" style={{padding:20}}>
        <h2 className="title">Welcome to HealthFi Vault</h2>
        <p className="subtitle">Your health savings, now with yield and verifiable milestones.</p>
        <div style={{display:'flex', gap:12, marginTop:12}}>
          <button className="button btn-primary">Create Vault</button>
          <button className="button btn-ghost">Learn More</button>
        </div>
      </motion.div>
    </div>
  );
}
